import React from 'react'

const ClearArrData = () => {
const CbioData = [
  {
id: 1, name: 'John', age: 30
  },
  {
    id: 2, name: 'Smith', age: 28

  },
  {
    id: 3, name: 'Henry', age: 26

  }

]

  return (
    <>
    <h1>Customer ID {CbioData.id}, Customer Name:{CbioData.name}, Customer Age{CbioData.age}</h1>
    </>
  )
}

export default ClearArrData
